import React from "react";
import { Nav } from "react-bootstrap";
import "./Navbar.css";
import { scroller } from "react-scroll";

export default function Navbar() {
  const scrollToContact = () => {
    scroller.scrollTo("contact", {
      duration: 800,
      delay: 0,
      smooth: "easeInOutQuart",
    });
  };

  return (
    <div>
      <Nav
        navbarScroll
        className="navBar justify-content-end"
        activeKey="/home"
      >
        <Nav.Item>
          <Nav.Link className="navItem" href="/home">
            Home
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" eventKey="about">
            About
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" eventKey="portfolio">
            Portfolio
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" onClick={scrollToContact}>
            Contact
          </Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
}
